    <nav>
      <img src={reactLogo} 
      alt="logo"
      className="nav--icon"
      />
      <h3>ReactFacts</h3>
      <h4>React Course - Project 1</h4>
    </nav>
  )
}
ReactDOM.render(
 <>
 <Navbar />
 <h1>hi</h1>
 </>
